import { Routes, Route } from "react-router-dom";


export const RoutesComputing = () => {
    return(
        <Routes>
            <Route path="/concepts/programming/cpp/" element={<h1>Estas en el Estudio de C++</h1>}/>
        </Routes>
    )
}

export const RoutesProgramming = () => {
    return(
        <Routes>
            <Route path="/concepts/programming/cpp/" element={<h1>Estas en el Estudio de C++</h1>}/>
        </Routes>
    )
}
